		private void drawSprite()
		{
			int drawX = (spriteX * 8);
			int drawY = ((spriteY * 8)*320);
			int x;
			int y;
			for(int i = 0; i < 64; i ++)
			{
				x = (i % 8);
				y = (i/8);
				if(defSprites[direction,y,x] != 64)
				{
					tileGraphics.render.colorArray[(((y*320)+drawY)+(x+drawX))] = defSprites[direction,y,x];
				}
			}
			tileGraphics.render.pixelPaint();
			tileGraphics.render.generate();
		}
		private void keyInput(object sender, PreviewKeyDownEventArgs e)
		{
			if(e.KeyCode == Keys.Space)
			{
				reset();
			}
			else if(!allLevels)
			{
				int oldX = spriteX;
				int oldY = spriteY;
				switch (e.KeyCode)
				{
				case Keys.Left:
					if(levels[levelNo,spriteY,spriteX - 1] != 0x82 && levels[levelNo,(spriteY + 30),spriteX - 1] != 0x80)
					{
						spriteX--;
						direction = 1;
					}
					else if(levels[levelNo,(spriteY + 30),spriteX - 1] ==  0x80 && levels[levelNo,spriteY,spriteX - 2] != 0x82 && levels[levelNo,(spriteY + 30),spriteX - 2] != 0x80)
					{
						levels[levelNo,(spriteY + 30),spriteX - 1] = 0x20;
						levels[levelNo,(spriteY + 30),spriteX - 2] = 0x80;
						spriteX--;
						direction = 1;
					}
					break;
				case Keys.Up:
					if(levels[levelNo,spriteY - 1,spriteX] != 0x82 && levels[levelNo,(spriteY + 30) - 1,spriteX] != 0x80)
					{
						spriteY--;
						direction = 2;
					}
					else if(levels[levelNo,(spriteY + 30) - 1,spriteX] ==  0x80 && levels[levelNo,spriteY - 2,spriteX] != 0x82 && levels[levelNo,(spriteY + 30) - 2,spriteX] != 0x80)
					{
						levels[levelNo,(spriteY + 30) - 1,spriteX] = 0x20;
						levels[levelNo,(spriteY + 30) - 2,spriteX] = 0x80;
						spriteY--;
						direction = 2;
					}
					break;
				case Keys.Right:
					if(levels[levelNo,spriteY,spriteX + 1] != 0x82 && levels[levelNo,(spriteY + 30),spriteX + 1] != 0x80)
					{
						spriteX++;
						direction = 0;
					}
					else if(levels[levelNo,(spriteY + 30),spriteX + 1] ==  0x80 && levels[levelNo,spriteY,spriteX + 2] != 0x82 && levels[levelNo,(spriteY + 30),spriteX + 2] != 0x80)
					{
						levels[levelNo,(spriteY + 30),spriteX + 1] = 0x20;
						levels[levelNo,(spriteY + 30),spriteX + 2] = 0x80;
						spriteX++;
						direction = 0;
					}
					break;
				case Keys.Down:
					if(levels[levelNo,spriteY + 1,spriteX] != 0x82 && levels[levelNo,(spriteY + 30) + 1,spriteX] != 0x80)
					{
						spriteY++;
						direction = 3;
					}
					else if(levels[levelNo,(spriteY + 30) + 1,spriteX] ==  0x80 && levels[levelNo,spriteY + 2,spriteX] != 0x82 && levels[levelNo,(spriteY + 30) + 2,spriteX] != 0x80)
					{
						levels[levelNo,(spriteY + 30) + 1,spriteX] = 0x20;
						levels[levelNo,(spriteY + 30) + 2,spriteX] = 0x80;
						spriteY++;
						direction = 3;
					}
					break;
				}
				drawLevel();
				drawBoxes();
				tileGraphics.forceUpdateTile(oldX,oldY);
				tileGraphics.pushTileArray();
				drawSprite();
				this.BackgroundImage = tileGraphics.render.output;
				this.Refresh();
				clearCheck();
			}
		}
