		private void drawLevel()
		{
			int x;
			int y;
			for(int i = 0; i < 1200; i++)
			{
				int comp;
				x = i % 40;
				y = (i - x)/40;
				tileGraphics.readTileArray(x,y,"index",out comp);
				if(comp != levels[levelNo,y,x])
				{
					if(levels[levelNo,y,x] == 129 || levels[levelNo,y,x] == 0x20)
					{
						tileGraphics.drawTile(x,y,levels[levelNo,y,x],63,8);
					}
					else if(levels[levelNo,y,x] == 130)
					{
						tileGraphics.drawTile(x,y,levels[levelNo,y,x],62,32);
					}
				}
			}
		}
		private void drawBoxes()
		{
			int x;
			int y;
			for(int i = 0; i < 1200; i++)
			{
				x = i % 40;
				y = (i - x)/40;
				if(levels[levelNo,y+30,x] == 0x80)
				{
					if(levels[levelNo,y,x] == 0x81)
					{
						tileGraphics.drawTile(x,y,levels[levelNo,y+30,x],36,32);
					}
					else
					{
						tileGraphics.drawTile(x,y,levels[levelNo,y+30,x],57,36);
					}
				}
			}
		}
		private void clearCheck()
		{
			int x;
			int y;
			int test = 0;
			int goal = 0;
			for(int i = 0; i < 1200; i++)
			{
				x = i % 40;
				y = ((i) - x)/40;
				if(levels[levelNo,y,x] == 0x81)
				{
					test = test + 2;
					goal ++;
					if(levels[levelNo,y+30,x] == 0x80)
					{
						goal++;
					}
				}
			}
			if(test == goal)
			{
				System.Console.Beep(349,250);
				System.Console.Beep(440,250);
				System.Console.Beep(494,250);
				System.Console.Beep(523,250);
				System.Console.Beep(698,250);
				if((levelNo) < levels.GetUpperBound(0))
				{
					levelNo ++;
					reset();
				}
				else
				{
					levelNo = 0;
					complete();
				}
			}
		}
		private void reset()
		{
				defineLevels();
				tileGraphics.clearTilemap(0,8);
				drawLevel();
				drawBoxes();
				tileGraphics.pushTileArray();
				direction = 0;
				drawSprite();
				this.BackgroundImage = tileGraphics.render.output;
				this.Refresh();
				allLevels = false;
		}
		private void complete()
		{
			tileGraphics.clearTilemap(63,0);
			tileGraphics.directText("all levels completed",63,0,10,14);
			tileGraphics.directText("press space to restart",63,0,9,15);
			tileGraphics.pushTileArray();
			this.BackgroundImage = tileGraphics.render.output; 
			this.Refresh();
			allLevels = true;
		}
	}
